        self.max_path = -1
        self.max_value = -1

        def solve_recursive(x, y, matrix, visited):
            if visited[x][y] == 1:
                return
            visited[x][y] = 1

            if matrix[x][y] == '.':
                self.max_path = max(self.max_path, abs(x - 1) + abs(y - 1))
                return
            if matrix[x][y] == '#':
                return
            if matrix[x][y] == 'V':
                self.max_value = max(self.max_value, x - 1)
                return
            if matrix[x][y] == 'H':
                self.max_value = max(self.max_value, x + 1)
                return
            if matrix[x][y] == '/':
                solve_recursive(x + 1, y, matrix, visited)
                solve_recursive(x - 1, y, matrix, visited)
                solve_recursive(x, y - 1, matrix, visited)
                solve_recursive(x, y + 1, matrix, visited)
            if matrix[x][y] == '\\':
                solve_recursive(x - 1, y, matrix, visited)
                solve_recursive(x + 1, y, matrix, visited)
                solve_recursive(x, y - 1, matrix, visited)
                solve_recursive(x, y + 1, matrix, visited)

